const Zone = (zone) => {

    document.getElementById("mylabel").innerHTML = zone.name;
    return (
     <div>
         <label id="mylabel">zone.name</label>
         <input name = "checky" type = "checkbox" value={zone.name}/>
     </div>
     
    )

}

export default Zone
